import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  state = {
    adresaF: []
  }
  componentDidMount(){
    this.setState({
      adresaF: [{id: 1,name: 'Value101'},{id: 2,name: 'Value102'}]
    })
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
         <ul>
           {this.state.adresaF.map((adresa : any) => ( //kjo eshte forma qysh loopim tek state me ja marr atributet
             <li>
               {adresa.name}
             </li>
           ))}
         </ul>
        </header>
      </div>
    );
  }

}

export default App;
